import { useState, useEffect } from "react";
import "./App.css";
import { PageOne } from "./components/PageOne";
import { PageTwo } from "./components/PageTwo";
import { Skip } from "./components/styledComponents/Skipbutton";

function App() {
  const [page, setPage] = useState(1);
  useEffect(() => {}, [page]);
  const handelPage = () => {
    setPage(page + 1);
  };
  const handelSkip = () => {
    setPage(page + 3);
  };

  return (
    <>
      {page === 1 ? (
        <PageOne handelPage={handelPage} handelSkip={handelSkip}>
          Skip
        </PageOne>
      ) : page === 2 ? (
        <PageTwo handelPage={handelPage} handelSkip={handelSkip} />
      ) : (
        <h1>connect to Homepage</h1>
      )}
    </>
  );
}

export default App;
